

from typing import List
from collections import defaultdict

class Solution:
    def hash_fun(self, arr: List[int]) -> dict:
        _hash = defaultdict(list)
        for i,ele in enumerate(arr):
            _hash[ele].append(i)
        return _hash
    
    def minJumps(self, arr: List[int]) -> int:  
        graph = self.hash_fun(arr)
        
        if len(arr) == 1: return 0
        ans = [0] * len(arr)
        queue = [len(arr)-1]
        
        while queue:
            idx = queue.pop(0)
            if idx == 0:
                return ans[0]
            if idx + 1 < len(arr) and ans[idx + 1] == 0:
                ans[idx + 1] = ans[idx] + 1
                queue.append(idx + 1)
            if idx - 1 >= 0 and ans[idx - 1] == 0:
                ans[idx - 1] = ans[idx] + 1
                queue.append(idx - 1)
            for e in graph[arr[idx]]:
                if ans[e] == 0 and e < len(arr) - 1:
                    ans[e] = ans[idx] + 1
                    queue.append(e)
            graph.pop(arr[idx])
        return ans[0]
    
    # not working 
    def minJumps2(self, arr: List[int]) -> int:  
        visited = defaultdict(int)
        graph = self.hash_fun(arr)
        queue = [len(arr)-1]
        while queue:
            idx = queue.pop(0)
            if idx == 0:
                return visited[0]
            if idx + 1 < len(arr) and visited[idx + 1] == 0:
                visited[idx + 1] = visited[idx] + 1
                queue.append(idx + 1)
            if idx - 1 >= 0 and visited[idx - 1] == 0:
                visited[idx - 1] = visited[idx] + 1
                queue.append(idx - 1)
            for e in graph.get(arr[idx],[]):
                if e < len(arr) - 1 and visited[e] == 0:
                    visited[e] = visited[idx] + 1
                    queue.append(e)
        return
    
